B.ZW=new A.a0("Es basiert auf dem Prinzip, dass Menschen h\xe4ufiger zu einem Spiel zur\xfcckkehren, wenn sie unvorhersehbare Belohnungen erhalten. Jedes Mal, wenn man das Rad dreht, k\xf6nnte man eine kleine oder gro\xdfe Belohnung bekommen \u2013 oder manchmal gar nichts. Das macht das Ganze besonders spannend, weil man nie wei\xdf, was als N\xe4chstes kommt.\n Hast du bemerkt, dass du \xf6fter das Spiel \xf6ffnest, nur um das Gl\xfccksrad zu drehen? F\xfchlst du dich motiviert, es immer wieder zu versuchen, in der Hoffnung, eine gr\xf6\xdfere Belohnung zu bekommen? Genau das ist die Absicht der Spieleentwickler: Sie wollen, dass du l\xe4nger im Spiel bleibst und vielleicht sogar echtes Geld ausgibst, um weitere Chancen auf Belohnungen zu bekommen.",null,null,null,null,null,null,null,null)
